import React from "react";
import { Containering, Wrappering } from "./NewCrudStyle";
import Dating from "./Dating"
const NewCrudHooks = () => {
  return (
    <Wrappering>
      <Containering>
        <table border={1} width="50%">
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Surname</th>
              <th>Status</th>
              <th>Action</th>
            </tr>
          </thead>
            <button>Add</button>
          <tbody>
            {Dating.map((value, index) => (
              <tr key={index}>
                <td>{value.id + 1}</td>
                <td>{value.name}</td>
                <td>{value.surname}</td>
                <td>{value.status}</td>
                <button>Delete</button>
                <button>Edit</button>
              </tr>
            ))}
          </tbody>
        </table>
      </Containering>
    </Wrappering>
  );
};

export default NewCrudHooks;
